a2b0b7&oe=5F7CBC57";}i:164;a:1:{s:4:"type";s:5:"image";}i:165;a:1:{s:8:"owner_id";i:104856571;}i:166;a:1:{s:14:"owner_username";s:0:"";}i:167;a:1:{s:14:"owner_fullname";s:0:"";}i:168;a:1:{s:9:"owner_pic";s:0:"";}i:169;a:1:{s:2:"id";s:19:"2391047435249461130";}i:170;a:1:{s:10:"short_code";s:11:"CEutPlbJyeK";}i:171;a:1:{s:12:"created_time";i:1599255087;}i:172;a:1:{s:7:"caption";s:2190:"So, this isn't a post that you'd normally see on somebody's 'work' page. But it's really, really important and I want to be upfront and honest with you all.....

I've started sending people like pre treatment advice prior to having their lip treatments. 

This includes buying and taking arnica tablets for a week before treatment, particularly if they are prone to bruising. 

As I tell everyone, it's really likely that you'll get some sort of little bruise. More people get bruises than not. For every 10 sets of lips I treat, probably only 5 get posted on my page. 

Let me tell you , that's true of every single practitioner out there. We don't post all of our work, of course we don'tÔøºÔøºÔøº. Because if we did would have to post pictures of pretty bruised and swollen lips. Of course, this doesn't mean the lips stay like this, 99% of the them heal beautifully and look great after a week or so. A few need a tweak, but...that's normal.

I treated this lovely lady a couple of weeks ago. With every single injection I made into the lip, she bruised more and more to the point of which I became quite concerned. 

I could not put my finger on why she was bruising in this way, at one point I thought she might of had an occlusionÔøº, she didn't. It was just bruising. We decided to stop treatment and finish in a couple of weeks. 

I finished the treatment and then checked in with her all evening. She bought arnica tablets and cream, cut down on alcohol, caffeine and took the tablets religiously for a week before we finished the treatment.

And tonight, we finished her lips.....not one single bruise in sight. Just beautiful lips.

